import React from "react";

function HTMLComponentBulletList(props) {
    let bulletList = props.bulletList;

    return (<>
        <ul>
            {
                (bulletList) && bulletList.map(entry => {
                    return <li key={entry}>{entry}</li>
                })
            }
        </ul>
    </>
    )
}

export default HTMLComponentBulletList;
